import React from 'react';
import './navbar.css';

function Navbar() {
   return (
<div class="navbar-content">
   <div class="logo">
      Logo
   </div>
   <div class="navbar-text">
      <p>Product</p>
      <p>Features</p>
      <p>Marketplace</p>
      <p>Company</p>
      <p>Log-in</p>
   </div>
   <div class="menu-button">
      <button id="menu-toggle">
         Menu
      </button>
   </div>
</div>
 )}

export default Navbar;
